import React from 'react';
import './App.css';
import TextField from '@material-ui/core/TextField';


function App() {
  return (
    <div className="App" style={{textAlign:"center"}}>
      Hello to Garbage Collector App<br/>
      <h3>Authtification</h3>
      <div style={{textAlign:"center",width:300}}>
        <form className="" noValidate autoComplete="off">
            <span>
              <TextField id="standard-basic" variant="outlined" label="Name" fullWidth={true} />
            </span><br/><br/>
            <span style={{marginTop:40}}>
              <TextField id="standard-basic" variant="outlined" label="Password" fullWidth={true} />
            </span>
        </form>
    </div>
    </div>
  );
}

export default App;
